const Course = (course) => {
    console.log(course.course.name)
    const {name} = (course.course)

    const Header = (props) =>{
        console.log(props.name)
        return (
        <div>
            <h1>{props.name}</h1>
        </div>
        )
    }

    const Content = (props) => {
        console.log(props.parts)
        const{parts} = props.parts
        return (
            <div>
                <ul>
                    {parts.map(part =>
                        <Part key={part.name} course={part.name} ex={part.exercises} />
                        )}
                </ul>
            <Part course={props.parts[0].name} ex={props.parts[0].exercises}/>
            <Part course={props.parts[1].name} ex={props.parts[1].exercises}/>
            <Part course={props.parts[2].name} ex={props.parts[2].exercises}/>
            </div>
        )
    }

    const Part = (props) => {
        return (
        <div>
            <p>{props.course} {props.ex}</p>
        </div>
        )
    }

    const Total = (props) => {
        return (
        <div>
            <p>{props.parts[0].exercises + props.parts[1].exercises + props.parts[2].exercises}</p>
        </div>
        )
    }

    return (
        
        <div>
            <Header name={name} />
            <Content parts ={course.course.parts} />
            <Total parts={course.course.parts} />
        </div>
    )

}


export default Course
